import { NavContent, NavBtn } from "./NavContainer";
import { useSelector, useDispatch } from "react-redux";
import { isModalClickedActions } from "../store";

const NavLogin = () => {
  const modalClicked = useSelector((state) => state.isModalClicked.value);
  return (
    <NavContent
      onClick={() => {
        useDispatch(isModalClickedActions.set(true));
      }}
    >
      <NavBtn>로그인/회원가입</NavBtn>
    </NavContent>
    // <div className="navContent">
    //   <button>로그인/회원가입</button>
    // </div>
  );
};

export default NavLogin;
